
let dataProd = {}
getAllProd()

async function getAllProd(){
	let res = await fetch("../getAllprodPricing.php")
	js = await res.json()
	for(i=0; i<js.length; i++){
		dataProd[js[i]['id']] = js[i]
	}
}


window.addEventListener("DOMContentLoaded",()=>{
	let totalAct_fl = false

	document.querySelector(".plus_png").addEventListener("click", plusAction)
	document.querySelector(".close_png").addEventListener("click", delAction)
	let input_count = document.querySelectorAll("input[name=count]")
	for(let i=0; i<input_count.length; i++){
		input_count[i].addEventListener("change", changeInpCount)
	}

	function changeInpCount(){
		let count = Number(this.value)
		if(!count){
			return
		}
		let parent = this.parentNode.parentNode
		let price = Number(parent.querySelector('input[name=price]').value)
		parent.querySelector('input[name=sum]').value = Math.ceil(price * count)
	}	

	function delAction(){
		this.parentNode.parentNode.remove()
	}

	function plusAction(){
		html = `<tr>
					<td><img class="close_png" src="/cms/img/close.png"></td>
					<td><input name='name' style="width: 200px;" type="text"></td>
					<td><input name='metr' style="width: 50px;" type="text"></td>
					<td><input name='count' style="width: 50px;" type="text"></td>
					<td><input name='price' style="width: 100px;" type="text"></td>
					<td><input name='sum' style="width: 100px;" type="text"></td>
				</tr>`
		document.querySelector("tbody").insertAdjacentHTML("beforeend", html)
		let c = document.querySelectorAll(".close_png")
		for(let i =0; i<c.length; i++){
			c[i].addEventListener("click", delAction)
		}
		let input_count = document.querySelectorAll("input[name=count]")
		for(let i=0; i<input_count.length; i++){
			input_count[i].addEventListener("change", changeInpCount)
		}
	}

	function insertProd(el){
		let id_pr = el.getAttribute("data_id")
		let lastRow = document.querySelector('tbody')
		lastRow = lastRow.querySelector('tr:last-child')
		let f_inp = lastRow.querySelector('td:nth-child(2)')
		f_inp = f_inp.querySelector('input')
		if(f_inp.value !=""){
			plusAction()
			lastRow = document.querySelector('tbody').querySelector('tr:last-child')
		}
		lastRow.querySelector("td:nth-child(2)").querySelector('input').value = dataProd[id_pr]['name']
		lastRow.querySelector("td:nth-child(3)").querySelector('input').value = dataProd[id_pr]['metric']
		lastRow.querySelector("td:nth-child(5)").querySelector('input').value = dataProd[id_pr]['price']
	}

	function liAction(e){
		if(e.target != e.currentTarget){
			return
		}
		let ch_ul = this.childNodes[1]
		if(!ch_ul){
			if(this.getAttribute('data_id')){
				insertProd(this)
			}
			return
		}
		if(ch_ul.classList.contains("openul")){
			let all_open_child_ul = this.querySelectorAll(".openul")
			let sum_px = all_open_child_ul[0].scrollHeight
			for(let i=0; i<all_open_child_ul.length; i++){
				all_open_child_ul[i].style.height = ""
				all_open_child_ul[i].classList.remove("openul")
			}
			let fl = true
			let ev = "ch_ul"
			while(fl){
				ev += ".parentNode"
				let p = eval(ev)
				if(p.tagName == "UL"){
					if(p.classList.contains("openul")){
						p.style.height = (p.scrollHeight - sum_px) + "px"
					}else{
						fl = false
					}
				}
			}
		}else{		
			let fl = true
			let ev = "this"
			while(fl){
				ev += ".parentNode"
				let p = eval(ev)
				if(p.tagName == "UL"){
					if(p.classList.contains("openul")){
						p.style.height = (p.scrollHeight + ch_ul.scrollHeight) + "px"
					}else{
						fl = false
					}
				}
			}
			ch_ul.style.height = ch_ul.scrollHeight + "px"
			ch_ul.classList.add("openul")
		}
	}


	let li = document.querySelectorAll("li")
	for(let i = 0; i<li.length; i++){
		li[i].addEventListener('click', liAction)
	}





	var docDefinition = {
		content:[
			{
				columns:[
					{image: "logo", width:70},
					{text:["Производство и установка натяжных потолков\n", {text:"auroom-nn.ru", link:"http://auroom-nn.ru",
							decoration: "underline", color:"blue"}], fontSize:15,
						width: "60%", alignment: "center", margin:[30, 0,30,0]},
					{text:"8(831)200-34-98 \n +7 996 567 37 62\n auroom-nn@mail.ru",alignment: "right"}
				]

			},
			{canvas: [
				{
					type: 'line',
					x1: 0,
					y1: 10,
					x2: 515,
					y2: 10,
					lineWidth: 1,
					lineColor: '#6c99e7',
				}]
			},
			{
				text:"Счет №",
				fontSize:20,
				alignment: "center",
				margin: [0, 30]
			},
			{
				table: {
        
        					headerRows: 1,
        					widths: [20,"*", 50, 50, 50,80],


        				body: [
          					["#",{text:'Наименование', bold: true, alignment:"center"}, {text:'Ед.Изм', bold: true, alignment:"center"}, {text:'Кол.', bold: true, alignment:"center"},
          					 {text:'Цена', bold: true, alignment:"center"},{text:'Сумма руб.', bold: true, alignment:"center"} ]     					
        				]
        				
      			}
			},
			{
				text: "",
				margin: [0,20],
				bold: true,
				alignment: "right"
			},

			{canvas: [
				{
					type: 'line',
					x1: 0,
					y1: 10,
					x2: 515,
					y2: 10,
					lineWidth: 1,
					lineColor: '#6c99e7',
				}]
			},

			{columns:[
					{width:200, text: "OOO Континент \nОГРН 1225200010375\nИНН 5256201932\nБанк АО «Тинькофф Банк»\nРасчетные счет 40702810810000234800"},
					{image: "pechat", margin:[-50,-20,0,0], width: 120}

				],
				margin: [0, 20]

			},

			],
			images:{
				logo: 'data:image/png;base64,',
				pechat: 'data:image/png;base64,'
			}
	}

	function totalAction(){
		if(totalAct_fl){
			return
		}
		totalAct_fl = true
		let inp = document.querySelectorAll("input[name=sum]")
		let sum = 0
		for(let i=0; i<inp.length; i++){
			sum += Number(inp[i].value)
		}
		plusAction()
		let tr = document.querySelector("tbody").querySelector('tr:last-child')
		tr.querySelector('input[name=name]').value = "Итого"
		tr.querySelector('input[name=sum').value = sum
		
	}

	function openPdfAction(){
		if(!totalAct_fl){
			totalAction()
		}
		let out_arr = []
		let tr = document.querySelector('tbody').querySelectorAll("tr")
		let numbPrice = document.querySelector("input[name=number_price]").value
		docDefinition.content[2]['text'] = "Счет №"+String(numbPrice)
		let sum = 0
		for(let i=0; i<tr.length; i++){
			let a = []
			a.push(i+1)
			let inp = tr[i].querySelectorAll('input')		
			if(inp[0].value == "Итого"){
				sum = inp[4].value
			}
			for(let j=0; j<inp.length; j++){
				let ob = {}
				if(j>0){
					ob.alignment = "center"
				}
				if(sum){
					ob.bold = true
				}
				ob.text = inp[j].value
				a.push(ob)
			}
			out_arr.push(a)
		}
		

		let naimenov = tr.length
		if(sum){
			naimenov -= 1
		}
		docDefinition.content[4]['text'] = `Всего наименований ${naimenov} на сумму ${sum} руб.`
		for(let i=0; i<out_arr.length; i++){
			docDefinition['content'][3]['table']['body'].push(out_arr[i])
		}
		// pdfMake.createPdf(docDefinition).open({}, window.open());
		pdfMake.createPdf(docDefinition).download(`Счет_потолки№${numbPrice}.pdf`)
	}
	 
	document.querySelector("button[name=total]").addEventListener('click', totalAction)

	document.querySelector("button[name=open]").addEventListener("click", openPdfAction) 
	
})